import React from 'react';
import inputForm from "./Input.module.css"

const Input = React.forwardRef((props)=> {
  return (
        <>
        <div className={inputForm.input}>
            <label htmlFor={props.input.id} >{props.label}</label>
            <input {...props.input} />
        </div>
        </>
  )
});

export default Input
